sources.signup.js:
import '@babel/polyfill';
import axios from "axios";// this is npm package requre to manage request

document.querySelector('#form-signup').addEventListener('submit', e => {
    e.preventDefault();

    const username = document.getElementbyId('un').value;
    const email = document.getElementById('em').value;
    const mobileno = document.getElementbyId('mn').value;
    const password = document.getElementById('pw').value;

    signup(username, email, mobileno, password);

});



const signup = async (un, em, mn, pw) => {
    try {
        await axios({
            method: "POST",
            url: "http://localhost:3000/api/v1/user/signup", // This url should be the url of your signup endpoint

            // All these data will be sent to your signup endpoint and accouding to your signup code new user will be created
            data: {
                un,
                em,
                mn,
                pw
            }
        });
    } catch (error) {
        console.log(error);
    }
}
